import React, { Component } from "react";

export default class Navbar extends Component {
  render() {
    return (
      <div>
        <header>
          <nav>
            <ul>
              <li> About </li> <li> Work </li> <li> Team </li>{" "}
              <li> Contact </li>
            </ul>
          </nav>
        </header>
      </div>
    );
  }
}
